import pyperclip
import matplotlib.pyplot as plt
import numpy as np


def viz(prev_cuts):
    arr = np.array(
        [np.hstack((np.inf * np.ones(len(prev_cuts[0]) - len(x)), x)) for x in prev_cuts])
    fig, ax = plt.subplots(num="prev cuts 2d")
    img = ax.imshow(arr, cmap="plasma")
    plt.imsave("test.png", arr)
    plt.colorbar(img)
    ax.set_xlabel("Right boundary index")
    ax.set_ylabel("Number of jumps")
    ax.set_title("Optimal previous cut indices")
    plt.show()


def viz_bars_3d(prev_cuts):
    fig, ax = plt.subplots(num="prev cuts 2d", subplot_kw={"projection": "3d"})
    arr = np.array([np.hstack((np.zeros(len(prev_cuts[0]) - len(x)), x))
                   for x in prev_cuts])
    grid = np.meshgrid(np.arange(arr.shape[0]), np.arange(arr.shape[1]))
    bottom = np.zeros_like(arr)
    # ax.scatter3D(*grid, arr)
    ax.bar3d(grid[0].ravel(), grid[1].ravel(), bottom.ravel(),
             1, 1, arr.ravel() + 1e-5, shade=True)
    # plt.colorbar(img)
    ax.set_xlabel("Right boundary index")
    ax.set_ylabel("Number of jumps")
    ax.set_zlabel("Index of previous cut")
    ax.set_title("Optimal previous cut indices")
    plt.show()


def lst_get(lst, idx):
    if idx < len(lst):
        return lst[idx]
    else:
        return None


def last_optimal_cut(prev_cuts, n_jumps, right_data_index):
    if n_jumps > right_data_index:
        return None
    else:
        if (cuts_for_jump := lst_get(prev_cuts, n_jumps)) is not None:
            if (x := lst_get(cuts_for_jump, right_data_index - n_jumps)) is not None:
                if x == 0:
                    return None
                else:
                    return x - 1


def trace(prev_cuts, n_jumps, right_data_index):
    if (cut := last_optimal_cut(prev_cuts, n_jumps, right_data_index)) is not None:
        cut_buffer = [0] * n_jumps
        cut_buffer[n_jumps - 1] = cut
        for jump_count in reversed(range(1, n_jumps)):
            cur_cut = cut_buffer[jump_count]
            prev = prev_cuts[jump_count][cur_cut - jump_count]
            cut_buffer[jump_count - 1] = prev - 1
        return cut_buffer
    return []


def all_traces(prev_cuts):
    return {(n, rb): tr
            for rb in range(len(prev_cuts))
            for n in range(rb)
            if (tr := trace(prev_cuts, n, rb)) != []}


def traces_to_edges(tr):
    edges = {}
    for (n, rb), seg in tr.items():
        for _ in range(n):
            edges[(n, rb)] = (n-1, seg[-1])
            n -= 1
            rb = seg[-1]
            seg.pop()
    return edges

