def traces_to_dot(prev_cut_shape, tr):
    lines = []
    edges = traces_to_edges(tr)
    for (n1, rb1), (n2, rb2) in edges.items():
        lines.append(f'"{(n1+1, rb1+1)}" -> "{(n2+1, rb2+1)}";') # [rank={n2}] [label="{n2}‚Üê{n1}"]
    
    for n in range(prev_cut_shape[0]):
        for rb in range(n, prev_cut_shape[0]):
            r = rb + 1 if edges.get((n, rb)) is None else edges[(n, rb)][1] + 1
            lines.append(f'"{(n+1, rb+1)}" [pos="{rb},{-2*n}!", shape=circle, label="{n+1}:{rb+1}"];')
        if n < prev_cut_shape[0] - 1:
            lines.append(f'"{(n+2, n+2)}" -> "{(n+1, n+1)}";')
        # nodes = list({x for tup in edges.items() for x in tup})
    # for (_, grp) in groupby(nodes, key=lambda tup: tup[0]):
    #     s = "; ".join(f'"{n},{rb}"' for (n, rb) in grp)
    #     lines.append(f"{{rank=same; {s}}}")
    return "\n".join(lines)


